import React from 'react';
import { MDBContainer, MDBRating } from 'mdbreact';


const RatingPage = () => {
  return (
    <MDBContainer>
      <MDBRating iconRegular />
      <MDBRating feedback/>
    </MDBContainer>
  );
};


export default RatingPage;
